import './App.css';
import Content from "./components/customer-page/contact/Content";
import Navigation from "./components/user-page/navigation/Navigation";
import Order from "./components/user-page/navigation/order/Order";
import CostCalculation from "./components/user-page/navigation/cost_calculation/cost_calculation";

function App() {
    return (
        <div className="App">

            <Navigation/>
            <Order.Order/>
            <CostCalculation/>
            <Content/>
        </div>
    );
}

export default App;
